@therealsolids Me souviens d’une vidéo où tu es en feu de camp avec blackout.
Je sais pas si c’était la meilleure époque. Ils étaient une vraiment bonne team soudée et ça faisait des jolies phases.
Me souviens d’une ou blackout se bat dans l’hôpital du vieux elek ou Cherno, s’évanouit, t’entend
